Student Nurses
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: After their well-deserved holidays, it's time for the girls to go back to nursing school. Anais, Laure, Lily and their adorable girlfriends are going back to class. They know that the new term is going to be hard for them, as exams are just around the corner, and they're only too aware that only the best of them will be allowed back for the 2nd year. Luckily, to release the pressure a bit, there's going to be big student night next week. Everybody's looking forward to it and has every intention of enjoying it-and each other.

Cast: Tiffany Doll , Athina , Lolita Taylor , Minnie Manga , Jenny (XVI) , Candy Belle , James Brossman , Mugur , Thomas Stone , Marc Dorcel Producer Franck Vicomte,  Director

